import axios from 'axios';


function WeatherView() {
    const [weatherToday, setWeatherToday] = useState([]);
    useEffect(() => {
        axios.get("http://dataservice.accuweather.com/currentconditions/v1/215854?apikey=uhtrRSo6CDxLgAFlBtnEZh2wWkRANgZf")
            .then((data) => {
                debugger;
                setWeatherToday(data.data);
            })
    }, []);
    return (
        <div>
            {weatherToday[1]['Temperature']['Metric']['Value']}
        </div>
    )

}
export default WeatherView;
